import { Link } from "react-router-dom";

const blogPosts = [
    { id: 1, title: "First Blog Post", content: "This is my first post!" },
    { id: 2, title: "React is Awesome!", content: "Let's learn React together." }
];

function Blog() {
    return (
        <div>
            <h2>Blog</h2>
            {blogPosts.map(post => (
                <div key={post.id}>
                    <h3>{post.title}</h3>
                    <p>{post.content}</p>
                    <Link to={`/blog/${post.id}`}>Read More</Link>
                </div>
            ))}
        </div>
    );
}

export default Blog;
